import logo from '../../as';
import './App.css';
import { Brand, Cta, Navbar } from './components';
import { Blog, Features, Header, Footer, Possibility, WhatGPT3 } from './containers';
function App() {
  return (
    <div className="App">
      <div className='gradient__bg'>
        <Navbar/>
        <Header/>
        </div>
  <Brand/>
      <WhatGPT3/>
      <Features/>
      <Possibility/>
      <Cta/>
      <Blog/>
      <Footer/>
    </div>
  );
}

export default App;
